                <input type="text" placeholder="Title"></input> <br />
                <input type="text" placeholder="Write a note"></input> <br />
                <div className="note__refresh">
                    <RefreshIcon />
                </div>
                <Button><AddIcon /></Button>
            </div>
            <div cla></div>
            <div className="note__item">
                <p>1st</p>
                <p></p>
            </div>
        </>
    )
}

export default Note;
